import React, { useState } from "react";
import "./Navbar.scss";

// Material Ui - Icons
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";
import SearchIcon from "@material-ui/icons/Search";
import Badge from "@material-ui/core/Badge";

import { Link } from "react-router-dom";

function Navbar() {
  const [showSearchLine, setShowSearchLine] = useState(false);

  return (
    <div className="navbar">
      <div className="navbar-container">
        <div className="navbar-left-side">
          <span>PRODUCTS</span>
        </div>
        <div className="navbar-center-side">LAPTOP SHOP</div>
        <div className="navbar-right-side">
          <div className="navbar-search">
            <input
              type="text"
              className={showSearchLine ? "active-search-line" : ""}
              onChange={e=>searchValueHandle(e.target.value)}
            />
            <SearchIcon />
          </div>
          <div className="navbar-cart">
            <Link to="/cart">
              <Badge badgeContent={2} color="secondary">
                <ShoppingCartIcon
                  style={{ width: "28px", height: "28px", color: "black" }}
                />
              </Badge>
            </Link>
          </div>
          <div className="navbar-account">
            <AccountCircleIcon
              style={{ width: "30px", height: "30px", color: "black" }}
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
